                    <ul>
                        <li>JavaScript</li>
                        <li>HTML5</li>
                        <li>CSS3</li>
                        <li>Materialize</li>
                        <li>Google Maps API</li>
                    </ul>
                </Row>
            </div>
        </div>
    )
}

export default P1Card;
